import React from "react";


function Listen() {

    return (
        <div>
            <iframe  ref="iframe" 
                style={{width:'100%',height:this.state.iFrameHeight, overflow:'visible'}}
                onLoad={() => {//iframe高度不超过content的高度即可
                    let h = document.documentElement.clientHeight - 20;
                    this.setState({
                        "iFrameHeight": h + 'px'
                    });
                }} 
                src={"Listen.html"}
            />
        </div>
    )
}

export default Listen;
